import React from 'react';
import BookCard from '../shared/Card/Card';


export default function Dublicates(props) {

    const duplicates = props.loadedBook.filter(function(book) {
        return props.userBookList.indexOf(book.id) != -1;
      });

    return(
        <BookCard duplicates={duplicates} />
    )

}
